=head1 NAME

Char::Prop::Unicode::BidiClass - Unicode 6.0.0 Bidi_Class property

=head1 SYNOPSIS

  use Char::Prop::Unicode::BidiClass;
  
  warn unicode_bidi_class_n 0x4E00;
  warn unicode_bidi_class_c "\x{4E00}";

=head1 DESCRIPTION

The C<Char::Prop::Unicode::BidiClass> module exports two
functions, C<unicode_bidi_class_n> and
C<unicode_bidi_class_c>, both return the value of Unicode
6.0.0 Bidi_Class property for the specified
character (or code position).  C<unicode_bidi_class_n>
accepts a number representing the code position, while
C<unicode_bidi_class_c> expects a (utf8-flagged) character,
as the first and only argument.

=head1 UNICODE VERSION

This module supports Unicode 6.0.0.



This module is expected to be updated once a newer version of Unicode
is released.



